import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import apiService from '../services/apiService';
import './Profile.css';

const Profile = () => {
  const { token } = useAuth();
  const navigate = useNavigate();
  const [profile, setProfile] = useState(null);
  const [formData, setFormData] = useState({
    name: '',
    address: '',
    dob: '',
    preferences: {},
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [successMessage, setSuccessMessage] = useState('');
  const [idProofFile, setIdProofFile] = useState(null);

  useEffect(() => {
    if (!token) {
      localStorage.setItem('redirectAfterLogin', '/profile');
      navigate('/login');
      return;
    }
    fetchProfile();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [token, navigate]);

  const fetchProfile = async () => {
    try {
      setLoading(true);
      const response = await apiService.getProfile(token);
      setProfile(response.data);
      setFormData({
        name: response.data.name || '',
        address: response.data.address || '',
        dob: response.data.dob || '',
        preferences: response.data.preferences || {},
      });
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to load profile');
    } finally {
      setLoading(false);
    }
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleFileChange = (e) => {
    setIdProofFile(e.target.files[0]);
  };

  const handleSaveProfile = async (e) => {
    e.preventDefault();
    try {
      setError('');
      setSuccessMessage('');

      const updateData = { ...formData };
      if (idProofFile) {
        updateData.idProofFile = idProofFile.name;
      }

      const response = await apiService.updateProfile(token, updateData);
      setProfile(response.data.user);
      setSuccessMessage(response.data.message);
      setTimeout(() => setSuccessMessage(''), 3000);
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to update profile');
    }
  };

  if (loading) return <div className="loading">Loading profile...</div>;

  return (
    <div className="profile-container">
      <div className="profile-card">
        <h2>üë§ My Profile</h2>

        {error && <div className="error-message">{error}</div>}
        {successMessage && <div className="success-message">{successMessage}</div>}

        <form onSubmit={handleSaveProfile}>
          <div className="form-group">
            <label>Name:</label>
            <input
              type="text"
              name="name"
              value={formData.name}
              onChange={handleInputChange}
              placeholder="Enter your full name"
            />
          </div>

          <div className="form-group">
            <label>Address:</label>
            <textarea
              name="address"
              value={formData.address}
              onChange={handleInputChange}
              placeholder="Enter your address"
              rows="3"
            />
          </div>

          <div className="form-group">
            <label>Date of Birth:</label>
            <input
              type="date"
              name="dob"
              value={formData.dob}
              onChange={handleInputChange}
            />
          </div>

          <div className="form-group">
            <label>ID Proof Upload (for KYC verification):</label>
            <input
              type="file"
              onChange={handleFileChange}
              accept=".pdf,.jpg,.jpeg,.png"
            />
            <p className="hint">Upload a PDF or image for sensitive field changes</p>
          </div>

          {profile && (
            <div className="kyc-status">
              <span className="label">KYC Status:</span>
              <span className={profile.pendingKYC ? 'pending' : 'verified'}>
                {profile.pendingKYC ? '‚è≥ Pending Approval' : '‚úÖ Verified'}
              </span>
            </div>
          )}

          <button type="submit">üíæ Save Profile</button>
        </form>

        <div className="disclaimer">
          <p><strong>Note:</strong> Changes to name, address, or date of birth will be marked as "Pending KYC Approval"</p>
        </div>
      </div>
    </div>
  );
};

export default Profile;
